import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import { connect } from 'react-redux';
import data from './data.json';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import User from './Screens/UserList';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      newData: []
    }


  }
  componentDidMount() {
    console.log("this,props", this.props)
    var arr = [];
    for (var i in Object.keys(data.users)) {
      for (var j in Object.values(data.users)) {
      }

      var key = Object.keys(data.users)[i]
      var values = Object.values(data.users)[j]
      arr.push({
        key: key,
        value: values
      })
    }
    this.setState({ newData: arr })
  }


  render() {
    console.log("data", this.state.newData)

    return (
      <Router>
        <Switch>
          <Route exact path="/UserType" component={User}>
          </Route>
        </Switch>
      </Router>
    );
  }
}
function mapStateToProps(state) {
  return {
    user: state.user,
  }
}
function mapStateToDispatch(state) {
  return {
    user: state.user,
  }
}
export default connect(mapStateToProps, mapStateToDispatch)(App)
